import React, { Component } from "react";

class Welcome extends Component {
  constructor() {
    super();
    this.state = {
      message: "Welcome visitor",
    };
  }

  render() {
    return (
      <h1>
        {this.props.name} a.k.a {this.props.heroName}
      </h1>
    );
  }
}

export default Welcome;
